INSERT INTO `cir_dimension` (`dim_id`, `eje_id`, `dim_desc`) VALUES
(1, 1, 'Es responsable y comprometido con su trabajo.'),
(2, 1, 'Es organizado y ordenado en su trabajo.'),
(3, 1, 'Constantemente monitorea mi trabajo, proponiéndome estrategias y remediales para mejorarlo cuando corresponda.'),
(4, 2, 'Es claro y preciso cuando transmite una información o pide una tarea.'),
(5, 2, 'Entrega la información necesaria para el desarrollo efectivo de mi trabajo.'),
(6, 3, 'Mantiene un trato con respeto y cordialidad en el trabajo.'),
(7, 3, 'Transmite los principios del Colegio y demuestra lealtad a ellos.'),
(8, 4, 'Es flexible y tolerante frente a otros puntos de vista.'),
(9, 4, 'Cuando hay problemas, escucha a los demás, para después tomar la mejor decisión.'),
(10, 4, 'Es capaz de adaptarse rápidamente ante las dificultades.'),
(11, 5, 'Ante las dificultades, actúa con calma, transmitiéndola a sus colaboradores y a la comunidad.'),
(12, 5, 'Enfrenta los problemas en forma directa y respetuosa.'),
(13, 5, 'Escucha con atención y acoge lo que se le dice.'),
(14, 5, 'Acepta y toma en cuenta sugerencias y críticas.'),
(15, 5, 'Reconoce cuando se equivoca y se preocupa de enmendar su error.'),
(16, 6, 'Constantemente me motiva a mejorar en mi labor.'),
(17, 6, 'Celebra y alienta mis éxitos y triunfos laborales.'),
(18, 6, 'Me apoya en las dificultades.'),
(19, 6, 'Me Inspira confianza y respeto.'),
(20, 6, 'Influye positivamente en mi trabajo.'),
(21, 6, 'Corrige con respeto y amabilidad.'),
(22, 6, 'Potencia mis capacidades individuales y me permite aportar en el trabajo.'),
(23, 6, 'Se preocupa y atiende mis problemas cuando lo necesito.'),
(24, 6, 'Se preocupa de que cuente con las herramientas (ambiente, material…) necesarias para realizar mi trabajo.'),
(25, 6, 'Se preocupa de asignarme tareas que soy capaz de realizar, o en el caso contrario, me brinda oportunidades para adquirir esas competencias.');
