(1395, 'Visión Estratégica', 100, 'Generar un Plan de Trabajo Anual con las actividades de biblioteca, indicando \r\na)	Mes / Nombre de la Actividad / Descripción de la Actividad/ Encargado / Recursos\r\nb)	Realizar una Carta Gantt con fechas de las actividades.\r\nCompartir el Plan de Trabajo a toda la Comunidad Educativa la Primera semana de Abril.\r\n', '2025-04-01'),
(1396, 'Supervisión de Equipos', 100, 'Monitorear la realización del regalo lector a través de:\r\n•	Una planilla con la calendarización de los regalos lectores de Iº y IIº ciclo.\r\n•	Compartir la calendarización en un drive con todos los involucrados e indicar si el curso y/o profesor asiste o no a su hora de regalo lector (indicando la situación sino asiste el docente)\r\n•	Indicar en el drive qué actividad realizó el docente en el regalo lector.\r\n', '2025-04-01'),
(1400, 'Obtener un puntaje igual o superior, en 10 puntos, al promedio SIMCE 2024', 100, 'Desarrollar diferentes acciones que potencien el trabajo en aula como: a) Monitorear el avance de los estudiantes b) Potenciar el trabajo de comprensión lectora c) Aplicar, a lo menos, 2 mini ensayos que reflejen los avances del curso en objetivos descendidos.', '2025-11-30'),
(1401, 'Gestión en la Sala de Clases', 100, 'Potenciar el avance académico de los alumnos de nivel intermedio: Realizando reforzamientos de habilidades, posterior al horario de clases.', '2025-03-30'),
(1402, 'Gestión en la Sala de Clases', 100, 'Potenciar el trabajo de habilidades de lectura y escritura en el curso potenciando:\r\n-	Estrategias de comprensión lectora.\r\n-	Escritura de oraciones completas.\r\n-	Estrategias de focalización y normalización.\r\n', '2025-05-30'),
(1403, 'Gestión en la Sala de Clases', 100, 'Desarrollar estrategias que potencian habilidades de la asignatura de matemática a) Nivelando a los alumnos descendidos – con la ayuda de la Educadora Diferencial b) Desarrollando el texto del estudiante (cuadernillo de trabajo en su totalidad) c) Aplicar mini test para monitorear el avance de los alumnos ', '2025-03-30'),
(1404, 'Gestión en la Sala de Clases', 100, 'Desarrollar un trabajo de normalización desde su asignatura a través de diferentes estrategias que promuevan el buena clima de aula como a) Potenciar líderes positivos b) Reconocer logros de los alumnos ', '2025-03-30'),
(1409, 'Excelencia en el Trabajo', 100, '-	Cumplir oportunamente con los protocolos de Coordinación Académica en cuanto a. 1) Entrega de Pruebas y/o guías para revisión y multicopiado 2) Completar leccionario en LIRMI 3) Desarrollar las planificaciones.', '2025-04-15'),
(1410, 'Gestión en la Sala de Clases', 100, '-	Organizar las Ferias que se realizan desde su asignatura con acciones como:\r\na)	Informar a los apoderados, al inicio del año escolar, de las actividades a desarrollar.\r\nb)	Enviar comunicaciones indicando a los estudiantes que deben “guardar” uno de sus experimentos realizados en clases.\r\n', '2025-03-30'),
(1411, 'Excelencia en el Trabajo', 100, '-	Cumplir oportunamente con los protocolos de Coordinación Académica en cuanto a. 1) Entrega de Pruebas y/o guías para revisión y multicopiado 2) Completar leccionario en LIRMI 3) Desarrollar las planificaciones.', '2025-04-15'),
(1412, 'Gestión en la Sala de Clases', 100, '-	Organizar las Ferias que se realizan desde su asignatura con acciones como:\r\na)	Informar a los apoderados, al inicio del año escolar, de las actividades a desarrollar.\r\nb)	Enviar comunicaciones indicando a los estudiantes que deben “guardar” uno de sus experimentos realizados en clases.\r\n', '2025-03-30'),
(1413, 'Gestión en la Sala de Clases', 100, 'Aplicar estrategias de normalización en clases como: a) Aplicar y respetar las 5N b) Entrega de instrucciones en forma clara c) Aplicar estrategias de auto aprendizaje de Mº Ligia como: 100%, umbral, hacer ahora , etc.', '2025-06-30'),
(1414, 'Gestión en la Sala de Clases', 100, 'Desarrollar clases que promuevan un aprendizaje significativo considerando la realidad de cada curso\r\nReflexionar sobre sus prácticas y reformular sus clases de ser necesarias.', '2025-06-30'),
(1415, 'Excelencia en el trabajo', 100, '-	Cumplir con los protocolos de Coordinación Académica en cuanto a plazos en la plataforma LIRMI de las planificaciones que debe completar.', '2025-03-30'),
(1416, 'Gestión en la Sala de Clases', 100, '- Escuchar, a lo menos, 10 minutos por clase de música Docta, de genios musicales.\r\n- Ejecutar motivos musicales de música Docta en sus instrumentos.\r\n', '2025-07-30'),
(1417, 'Excelencia en el trabajo', 100, 'Cumplir con los protocolos de Coordinación Académica en cuanto a las planificaciones en plataforma LIRMI', '2025-04-15'),
(1418, 'Gestión en la Sala de Clases', 100, 'Organizar su horario para desarrollar 1 vez al mes clases de Vida Saludable potenciando la alimentación sala y/o conceptos de la asignatura.', '2025-04-30'),
(1419, 'Trabajo en Equipo', 100, 'Desarrollar actividades físicas que involucren juegos matemáticos.\r\nMantener una comunicación fluida con los docentes de matemática para poder apoyar a dicha asignatura desde su subsector.\r\n', '2025-06-30'),
(1420, 'Excelencia en el trabajo', 100, 'Cumplir con los protocolos de Coordinación Académica en cuanto a plazos en la plataforma LIRMI de las planificaciones que debe completar.', '2025-03-30'),
(1421, 'Gestión en la Sala de Clases', 100, 'Nivelar al curso de 3º Básico A-B en escritura, con la finalidad de obtener logros importantes durante el primer semestre del año del 2025.', '2025-03-30'),
(1422, 'Obtener un puntaje igual o superior, en 10 puntos, al promedio SIMCE 2025', 100, 'Desarrollar diferentes acciones que potencien el trabajo en aula como: a) Monitorear el avance de los estudiantes b) Potenciar el trabajo de comprensión lectora c) Aplicar, a lo menos, 2 mini ensayos que reflejen los avances del curso en objetivos descendidos.', '2025-11-30'),
(1423, 'Excelencia en el trabajo', 100, 'Cumplir con los protocolos de Coordinación Académica en cuanto a plazos en la plataforma LIRMI de las planificaciones que debe completar.', '2025-03-30'),
(1424, 'Gestión en la Sala de Clases', 100, 'Desarrollar un trabajo de normalización, desde su jefatura, con el nuevo curso asignado en el año 2025.\r\nDesarrollar estrategias de focalización para un buen desarrollo de clases.\r\n', '2025-04-30'),
(1425, 'Gestión en la Sala de Clases', 100, 'Nivelar al curso de 3º Básico A-B en operatoria básica, con la finalidad de obtener logros importantes durante el primer semestre del año del 2025.', '2025-03-30'),
(1426, 'Excelencia en el trabajo', 100, 'Monitoreo el trabajo de todos mis estudiantes desarrollando las siguientes estrategias:\r\n1)	Organizar en el horario de la asignatura para poder desarrollar: habilidades (cuadernillo) y  geometría  en los diferentes periodos de clases.\r\n2)	Vincular el contenido de Geometría con la asignatura de Artes y/o Tecnología previa conversación con Profesor y Coordinación Académica\r\n', '2025-03-30'),
(1427, 'Obtener un puntaje igual o superior, en 10 puntos, al promedio SIMCE 2024', 100, 'Desarrollar diferentes acciones que potencien el trabajo en aula como: a) Monitorear el avance de los estudiantes b) Potenciar el trabajo de operatoria de tablas de multiplicar c) Aplicar, a lo menos, 2 mini ensayos que reflejen los avances del curso en objetivos descendidos.', '2025-11-30'),
(1428, 'Excelencia en el trabajo', 100, 'Continuar aprendiendo las funcionalidades de la plataforma LIRMI para \r\na) Monitorear y supervisar el libro digital en leccionario y firma \r\nb) Monitorear las notas en plataforma \r\nc) Indicar reemplazos y otros, etc.\r\n', '2025-07-30'),
(1429, 'Supervisión de Equipos', 100, 'Mantener un cuaderno y/o Excel con los permisos docentes y/o ausencias para organizar los reemplazos.', '2025-03-30'),
(1436, 'Gestión en la Sala de Clases', 100, 'Potenciar la comprensión lectora de los alumnos de 5º básico durante el primer semestre en conjunto con el Educador Diferencial desarrollando estrategias como:\r\nA)	Subrayado.\r\nB)	Notas al margen.\r\nC)	Lectura en voz alta.\r\nD)	Velocidad lectora, etc.\r\n', '2025-03-30'),
(1437, 'Gestión en la Sala de Clases', 100, 'Aplicar, a lo menos, 2 Pruebas de Habilidades a los cursos de 5º Básicos para conocer el avance de los estudiantes frente a la asignatura.', '2025-07-30'),
(1438, 'Trabajo en Equipo', 100, 'Desarrollar un trabajo en conjunto con Biblioteca, potenciando la lectura y/o escritura en un nivel a su cargo.', '2025-07-30'),
(1439, 'Trabajo en Equipos', 100, '-	Desarrollar un Plan de Trabajo de Inglés, indicando en cada curso qué actividades realiza en forma práctica y entregarlo a Coordinación Académica.', '2024-12-30'),
(1440, 'Excelencia en el trabajo', 100, '-	Cumplir con los protocolos de Coordinación Académica en cuanto a plazos en la plataforma LIRMI de las planificaciones que debe completar.', '2025-03-30'),
(1441, 'Gestión en la Sala de Clases', 100, 'Desarrollar una clase marcando el inicio, desarrollo y cierre – Desarrollar clases que promuevan un aprendizaje significativo considerando la realidad de cada curso – Reflexionar sobre sus prácticas y reformular sus clases de ser necesarias.', '2025-03-30'),
(1442, 'Gestión en la Sala de Clases', 100, 'Gestión en la Sala de Clases', '2025-03-30'),
(1443, 'Gestión en la Sala de Clases', 100, 'Trabajar con el texto de la asignatura y:\r\na)	Extraer los objetivos de la clase.\r\nb)	Modificar las actividades de acuerdo con las características de los cursos.\r\nc)	Consignar en LIRMI la clase según lo indicado en el punto a y b.\r\n', '2025-06-30'),
(1444, 'Trabajo en Equipo', 100, 'Participar activamente de las actividades del Colegio de Pastoral', '2025-03-30'),
(1445, 'Gestión en la Sala de Clases', 100, 'Trasmitir los valores que se requieren en una clase de Religión y la espiritualidad necesaria para que la clase sea significativa. \r\nOrganizando en clases:\r\na)	Realizar el momento de oración al iniciar la clase encendiendo la velita del altar para agradecer, pedir o reforzar los valores aprendidos.\r\nb)	Fomentar, en los estudiantes, la participación a través de la oración.\r\nc)	Reflexionar sobre diversas situaciones de acuerdo con la edad de los estudiantes.', '2025-04-30'),
(1446, 'Trabajo en Equipo', 100, 'Proponer acciones en beneficio del aprendizaje de los estudiantes como:\r\na)	Tomar lecturas.\r\nb)	Reforzar operatorias.\r\nAplicar pruebas atrasadas, etc', '2025-04-30'),
(1447, 'Gestión en la Sala de Clases', 100, 'Aplicar estrategias de normalización en clases como: a) Aplicar y respetar las 5N b) Entrega de instrucciones en forma clara c) Aplicar estrategias de auto aprendizaje de Mº Ligia como: 100%, umbral, hacer ahora , etc.', '2025-06-30'),
(1448, 'Consolidar el trabajo colaborativo ', 100, '- Coordinar su participación estratégica en reuniones de planificación conjunta. \r\n- Participar activamente en la determinación de ingresos o egresos del programa. \r\n- Sostener comunicación permanente con todos los profesionales indicados en los planes de trabajo de los estudiantes que atiende. \r\n', '2025-06-30'),
(1449, 'Aportar permanentemente a la comunidad, herramientas para la comprensión e intervención de las NEE ', 100, '- Cuando corresponda, participar de manera activa en reuniones con otras áreas del establecimiento, brindando opiniones y sugerencias especializadas.\r\n- Participar en los consejos de ciclo cuando se aborden situaciones críticas de sus estudiantes, brindando una perspectiva especializada de las dificultades y eventuales medidas a adoptar. \r\n', '2025-06-30'),
