(1598, 'Promover el respeto a los límites de sus funciones, enfocándose en las responsabilidades específicas de su rol docente y delegando de manera adecuada las tareas que le corresponden a otros miembros de PIE u otras áreas, con el fin de optimizar el trabajo colaborativos, evitar la duplicación de esfuerzos y evitar malos entendidos. ', 100, '- Comprender el alcance de sus funciones y delegar tareas confiando en las competencias de otros profesionales para fortalecer la colaboración. \r\n- Identificar situaciones  donde se tienda a asumir funciones ajenas y reflexionar antes de actuar. \r\n- Dialogar con coordinadora de PIE situaciones donde se deban tomar decisiones relevantes antes de implementarlas. \r\n\r\n', '2025-06-30'),
(1599, 'Fomentar relaciones saludables y profesionales con los estudiantes, estableciendo límites claros que respeten la asimetría necesaria en el vínculo docente-estudiante. ', 100, '- Mantener y transmitir claridad en los roles y expectativas (límites claros en la relación de docente-estudiante).\r\n- Utilizar un lenguaje respetuoso y profesional, evitando conductas que puedan malinterpretarse. \r\n- Mostrarse siempre imparcial en el vínculo que se establece con los estudiantes, reforzando la autoridad profesional sin comprometer la empatía necesaria. \r\n- Reflexionar constantemente sobre la interacción con los estudiantes, identificando áreas de mejora en el manejo de límites. \r\n', '2025-06-30'),
(1600, 'Afianzar el trabajo colaborativo, manteniendo una actitud de colaboración activa y efectiva dentro del equipo PIE. ', 100, '- Compartir información de manera clara y oportuna acerca de los estudiantes que atiende, fortaleciendo la toma de decisiones conjunta. \r\n- Valorar el rol y las contribuciones de otros profesionales, validando sus perspectivas para enriquecer las estrategias implementadas. \r\n', '2025-06-30'),
(1604, 'Garantizar el cumplimiento oportuno en la elaboración y actualización permanente del leccionario PIE, promoviendo una planificación organizada y alineada con las necesidades de los cursos.  ', 100, '- Elaborar tempranamente el diagnóstico de cada uno de los cursos que tiene a cargo (LIBRO DIGITAL), con el objetivo de optimizar la toma de decisiones y enriquecer las planificaciones conjuntas con las docentes de aula regular. \r\n\r\n- Mantener actualizados los  registros  de apoyo en aula, firmados de acuerdo a la normativa vigente.                                                                                                                                                                                                                            \r\n', '2025-06-30'),
(1605, 'Implementar estrategias inclusivas de enseñanza, adaptando materiales y metodologías a las necesidades individuales de los estudiantes, con el objetivo de mejorar los resultados en pruebas estandarizadas y asegurar que los estudiantes del programa participen del proceso y evidencien avances significativos.  ', 100, '- Identificar tempranamente las necesidades específicas de los estudiantes con NEE en relación a las asignaturas de lenguaje y matemáticas (habilidades críticas). \r\n- Implementar principios DUA en la planificación conjunta de las clases. \r\n- Crear e implementar materiales/recursos adaptados para facilitar el aprendizaje. \r\n- Monitorear continuamente el progreso de los estudiantes con NEE, adaptando las estrategias según los resultados observados. \r\n', '2025-11-14'),
(1606, 'Consolidar la implementación de talleres para el desarrollo de habilidades adaptativas ', 100, '- Elaborar e implementar talleres prácticos para estimular el desarrollo de habilidades, cognitivas/académicas, socioemocionales y funcionales para la vida.  ', '2025-11-14'),
(1619, 'Avanzar en el desarrollo de competencias profesionales para lograr un trabajo administrativo  de calidad.', 100, 'Revisar detenidamente el trabajo administrativo, asegurándose de no cometer errores en la escritura (ortografía, redacción, etc). \r\n- Utilizar lenguaje técnico en el desarrollo de los informes psicopedagógicos y otros documentos del programa. \r\n', '2025-06-30'),
(1620, 'Afianzar la práctica de codocencia y fortalecer su propio rol como docente en la sala de clases.  ', 100, '- Coordinar y planificar de manera efectiva el quehacer en el aula: definir roles, responsabilidades, actividades en aula.\r\n- Participar activamente en el desarrollo de las clases. \r\n- Propiciar planificaciones diversificadas y ofrecer permanentemente material que se ajuste a las diversas necesidades en el aula. \r\n- Implementar al menos dos estrategias de clima de aula en sus cursos.\r\n', '2025-06-30'),
(1621, 'Gestión en la sala de clases', 100, 'Reforzar permanentemente las nomas de buena convivencia. ', '2025-06-30'),
(1622, 'Mejorar la adherencia a las instrucciones y formatos establecidos por coordinación para la elaboración de instrumentos y documentos formales de PIE, cumpliendo con los plazos establecidos. ', 100, '- Asegurar el cumplimiento del 100% de los requisitos y orientaciones para la elaboración de instrumentos y documentos. \r\n- Hacer entrega del trabajo solicitado dentro de los plazos establecidos.\r\n- Aclarar dudas respecto a lo anterior con la coordinadora, solicitando revisión, sugerencias y correcciones antes de entregar un trabajo trabajo finalizado. \r\n- Sostener en el tiempo, autoevaluaciones críticas del trabajo realizado, identificando avances y áreas a mejorar. ', '2025-06-30'),
(1623, 'Fortalecer el rol docente como figura de autoridad educativa, mediante la implementación de estrategias que promuevan relaciones asimétricas saludables con los estudiantes, respetando y sosteniendo un rol de guía y facilitador de los aprendizajes. ', 100, '- Demostrar manejo equilibrado de la autoridad en el aula, evitando confusiones de roles en las interacciones que se establecen.\r\n- Establecer límites claros en las relaciones con los estudiantes, garantizando el respeto mutuo y el cumplimiento de normas. \r\n- Reflexionar periódicamente sobre sus prácticas docentes para identificar comportamientos que favorezcan la simetría y corregirlos. ', '2025-06-30'),
(1624, 'Fortalecer la capacidad proactiva para el diseño e implementación de estrategias y/o recursos inclusivos, proponiendo actividades adaptadas a las necesidades de sus estudiantes. ', 100, '- Diseñar intervenciones que contribuyan al desarrollo de habilidades cognitivas y académicas, posibles de implementar en sala y aula de recursos (enviar una planificación de las actividades a desarrollar). ', '2025-06-30'),
(1625, 'Fomentar la biblioteca digital ', 100, 'Realizar Talleres para profesores, alumnos y apoderados ', '2025-06-30'),
(1626, 'Implementar el taller lector en estudiantes de tercer ciclo  ', 100, 'Plan de trabajo con estudiantes ', '2025-06-30'),
(1627, 'Realizar actividades en biblioteca que fomente la lectura', 100, 'Plan de actividades de fomento lector ', '2025-06-30'),
(1628, 'Fomentar la biblioteca digital ', 100, 'Realizar Talleres para profesores, alumnos y apoderados.  ', '2025-06-30'),
(1629, 'Aplicar las estrategias de comprensión lectora y taller escritor ', 100, 'Implementar en distintas instancias en las clases de biblioteca las distintas estrategias ', '2025-06-30'),
(1630, 'Realizar seguimiento oportuno del trabajo del equipo ', 100, 'Acompañamiento en aula y diferentes actividades ', '2025-06-30'),
(1631, 'Talleres de sensibilización ', 100, 'plan de trabajo de actividades con apoderados, estudiantes y docentes.  ', '2025-06-30'),
(1632, 'Establecer procesos de ingreso de estudiantes NEE al area ', 100, 'Generar un proceso que permita optimizar los recursos humano con los que cuenta el área.  ', '2025-06-30'),
(1633, 'Potenciar el trabajo colaborativo del equipo PIE ', 100, 'Generar un plan de trabajo 2025', '2025-06-30'),
(1634, 'Monitorear el trabajo del equipo ', 100, 'planilla de seguimiento y acompañamiento al aula ', '2025-06-30'),
(1641, 'Implementacion de estrategias de comprensión lectora', 100, 'Generar plan de trabajo para los distintos niveles  ', '2025-06-30');
INSERT INTO `planificacion` (`plan_id`, `plan_meta`, `plan_importancia`, `plan_acciones`, `plan_plazo`) VALUES
(1642, 'Seguir realizando seguimiento y acompañamiento al equipo ', 100, 'Realizar seguimiento curricular y acompañamiento de Aula de todo el equipo  ', '2025-06-30'),
(1643, 'Análisis de los resultados de evaluaciones internas y externas ', 100, 'Jornadas de trabajo con docentes para revisar, analizar resultados y generar propuesta de mejoras. \r\nPresentar resultados a los apoderados.  ', '2025-06-30'),
(1644, 'Implementacion del nuevo plan de estudio  ', 100, 'Seguimiento de los procesos para las nuevas asignaturas incorporadas en el plan de estudio 2025', '2025-06-30'),
(1645, 'Seguir realizando seguimiento y acompañamiento del equipo ', 100, 'Realizar acompañamiento a todo el equipo u seguimiento de curricular de los docentes ', '2025-06-30'),
(1646, 'Analisis  de los resultados de evaluaciones internas y externas  ', 100, 'Jornada de trabajo con docentes para revisar, analiza resultados  y propuestas de mejoras. \r\nPresentar resultados a los apoderados. ', '2025-06-30'),
(1647, 'Colaborar en el registro del DIA en educación parvularia, de forma sistemática.', 100, 'Participar en: reuniones de equipo, talleres de análisis, capacitaciones. Registrar observaciones de sus estudiantes.', '2025-07-18'),
(1648, 'Implementar estrategias de clima de aula, rutinas de pensamiento y estrategias MAE en sus clases, de forma sistemática.', 100, 'Plaficiación de estrategias, analisis de estrategias para tomar decisiones de mejora continua, observar a educadoras para luego aplicar estrategias.', '2025-07-18'),
(1649, 'Implementar estrategias MAE de forma sistemática, desarrollando habilidades, conocimientos y actitudes a través del método COPISI.', 100, 'Participar en reuniones de análisis de estrategias implementadas. Sistematización de implementación de las estrategias MAE.', '2025-07-18'),
(1650, 'Implementar estrategias de comprensión lectora, estableciendo  metas y plazos para la adquisición de la lectura de todos sus estudiantes.', 100, 'Participar en reuniones de análisis de resultados pruebas DIA, organización estrategias MAE, reuniones de apoderados donde se difundan resultados, estrategias e importancia del apoyo familiar en el proceso de lectoescritura.', '2025-07-18'),
(1651, 'Planificar, implementar y evaluar experiencias de aprendizaje, utilizando los laboratorios de computación, tributando a objetivos de aprendizaje de diferentes asignaturas.', 100, 'Organización uso de laboratorio, planificación de experiencias de aprendizaje, entre otros.', '2025-07-18'),
(1654, 'Promover el trabajo colaborativo con su equipo de trabajo, generando instancias de reuniones donde se revisen temas relevantes del nivel, se tomen acuerdos y se realice seguimiento de ellos.', 100, 'Participar en: reuniones con coordinaciones, reuniones de nivel, reuniones con su asistente de aula, tomar acta de reuniones, informar acuerdos, revisar acuerdos, entre otros.', '2025-07-18'),
(1655, 'Sistematizar registros del DIA, incorporando a su asistente de aula, analizando resultados y tomando decisiones de mejora.', 100, 'Participar en talleres de resultados, reuniones, capacitaciones, entre otras.', '2025-07-18'),
(1658, 'Sistematizar estrategias MAE, promoviendo el aprendizaje profundo en sus estudiantes, a partir del método COPISI.', 100, 'Revisión y organización de estrategias MAE. Reuniones de análisis. Difusión de estrategias con apoderados.', '2025-07-18'),
(1659, 'Implementar estrategias de transición educativa, dando continuidad al proceso de transición.', 100, 'Participación en traspaso de jefatura, organización de 1era reuniñon de apoderados, dar continuidad a estrategias implementadas en kinder, reuniones de equipo , entre otras.', '2025-07-18'),
(1660, 'Planificación, implementación y evaluación de experiencias de aprendizaje, de diferentes asignaturas, utilizando laboratorios de computación.', 100, 'Reuniones de organización uso laboratorio, sistematización de uso del recurso, planificación, búsqueda de recursos tics.', '2025-07-18'),
(1661, 'Sistematizar registro DIA en educación parvularia, contribuyendo en las observaciones de sus estudiantes y análisis de resultados.', 100, 'Participación en  talleres, reuniones de registro DIA y evaluación autentica. Registrar observaciones de estudiantes  en nivel de Kinder.', '2025-07-18'),
(1662, 'Participar en estrategias de transición educativa de estudiantes de 1ero básico.', 100, 'Reuniones con equipo de 1ero. Análisis estrategias de transición, mantener comunicación sobre situaciones de estudiantes. ', '2025-07-18'),
(1663, 'Conocer en profundidad los cambios asociados al Reglamento Interno del establecimiento.', 100, '•	Estudio y análisis: Revisión detallada del Reglamento Interno actualizado, con especial énfasis en las modificaciones recientes.\r\n•	Reflexión en equipo: Reuniones periódicas con el equipo de mediadores para discutir casos prácticos y cómo los cambios impactan en la gestión diaria.\r\n•	Evaluación continua: Realización de retroalimentación continua de la implementación del RICE para asegurar la comprensión y aplicación efectiva del Reglamento.\r\n', '2025-06-20'),
(1664, 'Diseñar un plan de actividades con el ciclo en el que trabaja, incorporando estrategias de acompañamiento acordes al rol de los mediadores e implementarlo durante el 2025.', 90, '•	Definición de objetivos claros: Establecer metas claras y alcanzables para el ciclo de actividades, con énfasis en la promoción del bienestar estudiantil y la resolución pacífica de conflictos.\r\n•	Estrategias inclusivas: Diseñar actividades que favorezcan la integración de todos los estudiantes, promoviendo la participación activa y el trabajo en equipo.\r\n•	Acompañamiento personalizado: Crear un sistema de seguimiento para identificar a los estudiantes que necesiten un apoyo adicional (por razones conductuales o por asistencia), ajustando las estrategias según el contexto.\r\n•	Planificación colaborativa: Trabajar con otros profesionales del establecimiento, como psicólogos u orientadores, para garantizar que las actividades sean lo más inclusivas posible.\r\n', '2025-06-20'),
(1665, 'Aplicar sanciones disciplinarias, formativas y reparatoria, acordes y coherentes con nuestro Reglamento Interno de Convivencia Escolar (RICE) y normativa educacional, coordinando con profesionales de apoyo cuando sea necesario.', 90, '•	Evaluación de la conducta: Analizar cada caso individualmente, basándose en los hechos y en la normativa del RICE para determinar la sanción más apropiada. Las sanciones deben ser proporcionales al grado de la falta cometida.\r\n•	Escalabilidad de sanciones: Implementar un sistema de sanciones escalonadas que permita a los estudiantes aprender de sus errores, con sanciones leves para las faltas menores y más severas para conductas reiteradas o graves.\r\n•	Registro de sanciones: Mantener un registro detallado de todas las sanciones aplicadas, asegurando transparencia y coherencia en la toma de decisiones.\r\n', '2025-06-20'),
(1666, 'Fomentar el trabajo en equipo entre mediadores, propiciando instancias de encuentro.', 80, '•	Fomentar la comunicación abierta y constante entre los mediadores, promoviendo la colaboración en proyectos y actividades comunes.', '2025-06-20'),
(1667, 'Conocer en profundidad los cambios asociados al Reglamento Interno del establecimiento.', 90, '•	Estudio y análisis: Revisión detallada del Reglamento Interno actualizado, con especial énfasis en las modificaciones recientes.\r\n•	Reflexión en equipo: Reuniones periódicas con el equipo de mediadores para discutir casos prácticos y cómo los cambios impactan en la gestión diaria.\r\n•	Evaluación continua: Realización de retroalimentación continua de la implementación del RICE para asegurar la comprensión y aplicación efectiva del Reglamento.\r\n', '2025-06-20'),
