(1669, 'Aplicar sanciones disciplinarias, formativas y reparatoria, acordes y coherentes con nuestro Reglamento Interno de Convivencia Escolar (RICE) y normativa educacional, coordinando con profesionales de apoyo cuando sea necesario.', 100, '•	Evaluación de la conducta: Analizar cada caso individualmente, basándose en los hechos y en la normativa del RICE para determinar la sanción más apropiada. Las sanciones deben ser proporcionales al grado de la falta cometida.\r\n•	Escalabilidad de sanciones: Implementar un sistema de sanciones escalonadas que permita a los estudiantes aprender de sus errores, con sanciones leves para las faltas menores y más severas para conductas reiteradas o graves.\r\n•	Registro de sanciones: Mantener un registro detallado de todas las sanciones aplicadas, asegurando transparencia y coherencia en la toma de decisiones.\r\n', '2025-06-20'),
(1670, 'Generar instancias de vinculación y comunicación activa entre docentes y la coordinadora de tercer ciclo, fomentando el trabajo en equipo e intervenciones tempranas en estudiantes críticos.', 90, '•	Organizar encuentros regulares entre la coordinadora de tercer ciclo y los docentes para discutir el progreso de los estudiantes, compartir preocupaciones y planificar intervenciones conjuntas.\r\n•	Fomentar que los docentes comuniquen de manera activa sobre cualquier cambio significativo en el comportamiento de los estudiantes críticos.\r\n•	Trabajar en equipo para diseñar e implementar estrategias de apoyo que involucren a docentes, coordinadora y otros profesionales de apoyo para intervenir de manera integral con los estudiantes en riesgo.\r\n', '2025-06-20'),
(1671, 'Conocer en profundidad los cambios asociados al Reglamento Interno del establecimiento.', 80, '•	Estudio y análisis: Revisión detallada del Reglamento Interno actualizado, con especial énfasis en las modificaciones recientes.\r\n•	Reflexión en equipo: Reuniones periódicas con el equipo de mediadores para discutir casos prácticos y cómo los cambios impactan en la gestión diaria.\r\n•	Evaluación continua: Realización de retroalimentación continua de la implementación del RICE para asegurar la comprensión y aplicación efectiva del Reglamento.\r\n', '2025-06-20'),
(1672, 'Diseñar un plan de actividades con el ciclo en el que trabaja, incorporando estrategias de acompañamiento acordes al rol de los mediadores e implementarlo durante el 2025.', 80, '•	Definición de objetivos claros: Establecer metas claras y alcanzables para el ciclo de actividades, con énfasis en la promoción del bienestar estudiantil y la resolución pacífica de conflictos.\r\n•	Estrategias inclusivas: Diseñar actividades que favorezcan la integración de todos los estudiantes, promoviendo la participación activa y el trabajo en equipo.\r\n•	Acompañamiento personalizado: Crear un sistema de seguimiento para identificar a los estudiantes que necesiten un apoyo adicional (por razones conductuales o por asistencia), ajustando las estrategias según el contexto.\r\n•	Planificación colaborativa: Trabajar con otros profesionales del establecimiento, como psicólogos u orientadores, para garantizar que las actividades sean lo más inclusivas posible.\r\n', '2025-06-20'),
(1673, 'Aplicar sanciones disciplinarias, formativas y reparatoria, acordes y coherentes con nuestro Reglamento Interno de Convivencia Escolar (RICE) y normativa educacional, coordinando con profesionales de apoyo cuando sea necesario.', 100, '•	Evaluación de la conducta: Analizar cada caso individualmente, basándose en los hechos y en la normativa del RICE para determinar la sanción más apropiada. Las sanciones deben ser proporcionales al grado de la falta cometida.\r\n•	Escalabilidad de sanciones: Implementar un sistema de sanciones escalonadas que permita a los estudiantes aprender de sus errores, con sanciones leves para las faltas menores y más severas para conductas reiteradas o graves.\r\n•	Registro de sanciones: Mantener un registro detallado de todas las sanciones aplicadas, asegurando transparencia y coherencia en la toma de decisiones.\r\n', '2025-06-20'),
(1674, 'Fomentar instancias de comunicación efectiva con los miembros de la comunidad escolar, transmitiendo mis mensajes de manera clara y constructiva.', 100, '•	Practicar la escucha activa, donde se pone énfasis en comprender las necesidades y emociones de los demás antes de responder.\r\n•	Crear un ambiente en el que los miembros de la comunidad escolar se sientan cómodos expresando sus preocupaciones y pensamientos, asegurando que sus opiniones sean valoradas y consideradas.\r\n•	Crear un sistema de retroalimentación donde se valore el intercambio de ideas de manera positiva y respetuosa. La retroalimentación debe ser específica, orientada a la mejora y equilibrada entre lo positivo y lo constructivo.\r\n', '2025-06-20'),
(1675, 'Conocer en profundidad los cambios asociados al Reglamento Interno del establecimiento.', 80, '•	Estudio y análisis: Revisión detallada del Reglamento Interno actualizado, con especial énfasis en las modificaciones recientes.\r\n•	Reflexión en equipo: Reuniones periódicas con el equipo de mediadores para discutir casos prácticos y cómo los cambios impactan en la gestión diaria.\r\n•	Evaluación continua: Realización de retroalimentación continua de la implementación del RICE para asegurar la comprensión y aplicación efectiva del Reglamento.\r\n', '2025-06-20'),
(1676, 'Diseñar un plan de actividades con el ciclo en el que trabaja, incorporando estrategias de acompañamiento acordes al rol de los mediadores e implementarlo durante el 2025.', 80, '•	Definición de objetivos claros: Establecer metas claras y alcanzables para el ciclo de actividades, con énfasis en la promoción del bienestar estudiantil y la resolución pacífica de conflictos.\r\n•	Estrategias inclusivas: Diseñar actividades que favorezcan la integración de todos los estudiantes, promoviendo la participación activa y el trabajo en equipo.\r\n•	Acompañamiento personalizado: Crear un sistema de seguimiento para identificar a los estudiantes que necesiten un apoyo adicional (por razones conductuales o por asistencia), ajustando las estrategias según el contexto.\r\n•	Planificación colaborativa: Trabajar con otros profesionales del establecimiento, como psicólogos u orientadores, para garantizar que las actividades sean lo más inclusivas posible.\r\n', '2025-06-20'),
(1677, 'Aplicar sanciones disciplinarias, formativas y reparatoria, acordes y coherentes con nuestro Reglamento Interno de Convivencia Escolar (RICE) y normativa educacional, coordinando con profesionales de apoyo cuando sea necesario.', 100, '•	Evaluación de la conducta: Analizar cada caso individualmente, basándose en los hechos y en la normativa del RICE para determinar la sanción más apropiada. Las sanciones deben ser proporcionales al grado de la falta cometida.\r\n•	Escalabilidad de sanciones: Implementar un sistema de sanciones escalonadas que permita a los estudiantes aprender de sus errores, con sanciones leves para las faltas menores y más severas para conductas reiteradas o graves.\r\n•	Registro de sanciones: Mantener un registro detallado de todas las sanciones aplicadas, asegurando transparencia y coherencia en la toma de decisiones.\r\n', '2025-06-20'),
(1678, 'Realizar intervenciones tempranas en estudiantes con baja asistencia escolar, en coordinación con el área de familia, para implementar estrategias de apoyo personalizadas que favorezcan su regreso al aula y mejoren su rendimiento académico.', 100, 'Identificación temprana de estudiantes con baja asistencia: Monitoreo diario de la asistencia: Implementar un sistema de seguimiento riguroso para identificar a los estudiantes con ausencias recurrentes desde las primeras semanas del ciclo escolar.\r\nLlamadas y reuniones de seguimiento: Contactar a las familias de los estudiantes con baja asistencia de manera inmediata para comprender las razones detrás de las ausencias.\r\nCoordinar con el área de familia, psicólogos, orientadores y otros profesionales para comprender el contexto del estudiante y crear un plan de intervención integral.\r\nRealizar un seguimiento semanal de la asistencia del estudiante después de la intervención inicial, asegurando que las estrategias estén dando resultados.\r\n', '2025-06-20'),
(1679, 'Diseñar e implementar un plan de trabajo 2025 basado en los diagnósticos de 2024, evaluando el trabajo realizado, las necesidades detectadas y los resultados del consejo anual.', 100, '•	Análisis de los diagnósticos 2024: Recolectar y revisar la información de los diagnósticos realizados durante el año 2024, incluyendo los resultados de encuestas, entrevistas y observaciones de comportamiento.\r\n•	Evaluar las necesidades detectadas en el consejo anual y los informes de los mediadores, identificando las áreas clave de mejora en términos de convivencia escolar y resolución de conflictos.\r\n•	Elaborar un plan de trabajo detallado para el año 2025, incorporando estrategias específicas para abordar las necesidades detectadas en el diagnóstico.\r\n•	Incluir en el plan la participación activa de los mediadores y otros actores clave en la comunidad educativa, asegurando la colaboración transversal.\r\n•	Presentar el plan de trabajo 2025 al equipo directivo y a los mediadores para su revisión y retroalimentación.\r\n•	Realizar ajustes finales al plan en función de las sugerencias recibidas y asegurarse de que todos los involucrados estén comprometidos con las metas y acciones definidas.\r\n', '2025-03-31'),
(1680, 'Implementar estrategias de resolución de conflictos de manera temprana en los distintos ciclos, promoviendo un ambiente de respeto entre estudiantes.', 90, '•	Incluir prácticas y dinámicas que les permitan aplicar las técnicas de mediación de forma efectiva en distintos contextos.\r\n•	Promover que los mediadores y docentes intervengan de manera inmediata cuando surjan conflictos entre estudiantes, utilizando herramientas de mediación como el diálogo estructurado y la escucha activa.\r\n•	Organizar actividades y campañas de sensibilización sobre la importancia del respeto mutuo, la empatía y la resolución pacífica de conflictos.\r\n•	Incluir actividades como talleres de habilidades socioemocionales, debates, y juegos de rol, para ayudar a los estudiantes a comprender y aplicar estas estrategias en situaciones cotidianas.\r\n•	Realizar un seguimiento regular de las intervenciones en conflictos para evaluar su eficacia y realizar ajustes cuando sea necesario.\r\n', '2025-06-20'),
(1681, 'Brindar apoyo administrativo a los mediadores de ciclo según sea necesario.', 80, '•	Proveer a los mediadores con los materiales y recursos necesarios para sus intervenciones, como manuales, formularios, y recursos educativos.\r\n•	Brindar soporte continuo en la supervisión y acompañamiento de estudiantes, evaluación de casos y actividades, facilitando la organización administrativa.\r\n', '2025-06-20'),
(1682, 'Generar e implementar talleres preventivos e intervenciones en grupos pequeños para abordar temas relevantes y promover buenas prácticas en el área de convivencia.', 90, '•	Crear talleres interactivos y dinámicas grupales que aborden estos temas clave, diseñados para cada ciclo escolar de manera apropiada según la edad y el contexto de los estudiantes.\r\n•	Organizar intervenciones en grupos pequeños para poder abordar de manera más personalizada las necesidades de los estudiantes que requieren atención particular (ej. casos de bullying o conflictos recurrentes).\r\n•	Implementar mecanismos de evaluación de los talleres, como encuestas de satisfacción y reflexiones grupales, para medir el impacto y ajustar los contenidos y enfoques según sea necesario.\r\n', '2025-06-20'),
(1683, 'Proveer apoyo emocional y conductual a los estudiantes que presentan desregulación.', 100, '•	Implementar un sistema de monitoreo regular para detectar signos tempranos de desregulación en los estudiantes (conductas disruptivas, signos de ansiedad, agresividad, etc.).\r\n•	Brindar intervenciones individualizadas a estudiantes críticos, aplicando técnicas de manejo de emociones.\r\n•	Fomentar la creación de protocolos claros de contención, asegurando que los estudiantes reciban el apoyo adecuado sin crear situaciones de escalada o aislamiento.\r\n•	Coordinar con otros miembros del equipo de convivencia y de apoyo psicopedagógico para implementar planes de acción integrales que aborden la desregulación de manera multidisciplinaria.\r\n', '2025-06-20'),
(1684, 'Brindar apoyo personalizado a estudiantes con autismo en el área de convivencia, facilitando su integración y participación en las actividades escolares, en coordinación con áreas de apoyo.', 70, '•	Apoyar en la creación planes de apoyo específicos para los estudiantes con autismo que lo requieran, en colaboración con los profesionales de apoyo, para abordar sus necesidades particulares en términos de convivencia e integración.\r\n•	Apoyar en la organizar talleres y sesiones de sensibilización sobre el autismo para docentes, apoderados y estudiantes, enfocándose en cómo apoyar y trabajar de manera inclusiva con estudiantes con autismo.\r\n', '2025-06-20'),
(1685, 'Apoyar al equipo de convivencia en tareas como supervisión de estudiantes con autismo, aplicación de medidas disciplinarias y formativas acordes a las necesidades de los estudiantes.', 90, '•	Proveer acompañamiento en situaciones donde los estudiantes con autismo puedan experimentar dificultades en el contexto escolar, como durante recreos, cambios de aula o actividades grupales.\r\n•	Colaborar con el equipo de convivencia para aplicar medidas disciplinarias que sean adaptadas a las necesidades individuales de los estudiantes con autismo, evitando castigos punitivos que no sean efectivos para su desarrollo emocional y social.\r\n•	Implementar medidas formativas, como la enseñanza explícita de habilidades sociales y de resolución de conflictos, para apoyar el aprendizaje y crecimiento de los estudiantes en situaciones de desregulación.\r\n', '2025-06-20'),
(1686, 'Realizar intervenciones preventivas que impacten en la disminución de atenciones en el área de enfermería.', 100, '•	Crear y mantener canales de comunicación abiertos y efectivos con los mediadores y apoderados, utilizando correos electrónicos, reuniones y uso de plataformas escolares para la actualización constante sobre temas de salud de los estudiantes.\r\n•	Facilitar la comunicación directa entre el área de enfermería y las familias, asegurando que los apoderados reciban instrucciones claras en caso de situaciones de emergencia o seguimiento médico.\r\n•	Proveer información clara y detallada sobre las medidas preventivas adoptadas por el Colegio, tanto a mediadores como a apoderados, para asegurar que todos estén alineados con los protocolos establecidos para el bienestar de los estudiantes.\r\n', '2025-06-20'),
(1687, 'Coordinar con mediadores, docentes y asistentes acerca del abordaje de casos.', 90, '•	Definir roles claros y protocolos de comunicación para asegurar que todos los involucrados estén al tanto de las necesidades de los estudiantes y actúen de manera coordinada.\r\n•	Asegurar que todas las personas encargadas de la atención del estudiante reciban capacitación o información necesaria sobre cómo abordar situaciones de salud y bienestar.\r\n•	Implementar un sistema de seguimiento y retroalimentación para monitorear el progreso de los estudiantes con condiciones de salud específicas, manteniendo informados a los mediadores, docentes y asistentes sobre el estado y las necesidades de los estudiantes.\r\n', '2025-06-20'),
(1688, 'Entregar atención cordial y asertiva a los estudiantes como a apoderados', 90, '•	Establecer un ambiente seguro y de confianza donde los estudiantes se sientan cómodos expresando sus problemas de salud o bienestar.\r\n•	Responder de manera clara y empática a las inquietudes de los estudiantes, utilizando un lenguaje adecuado para su edad y nivel de comprensión.\r\n•	Establecer una actitud amable y accesible en todo momento, para que los apoderados se sientan cómodos acercándose cuando necesiten retroalimentación.\r\n', '2025-06-20'),
(1692, 'Colaborar en proceso de transición de estudiantes, tanto de Kinder a 1ero como de 2do a 3ero, implementando estrategias de clima de aula y rutinas de pensamiento.', 100, 'Participar en consejo de evaluación, aportando ideas, reuniones, talleres y otros.', '2025-07-18'),
