(1724, 'Implementar estrategias de transición en 1ero básico, dando continuidad a estrategias que han funcionado en el nivel de kinder y velando por un proceso de transición adecuado y sano .', 100, 'Participar en traspaso de jefatura, reunionesy talleres. Planificar experiencias que favorezcan el proceso de transición de estudiantes: juegos en  recreo, acogida, ensayar almuerzo, estrategias MAE, entre otros.', '2025-07-18'),
