(1726, 'Implementar estrategias de aprendizaje en diversas asignaturas, incorporando el uso de laboratorio y tics.', 100, 'Organizar clases en laboratorio, planificar, implementar y evaluar.', '2025-07-18'),
(1727, 'Implementar estrategias inclusivas de enseñanza, adaptando materiales y metodologías a las necesidades individuales de los estudiantes, con el objetivo de mejorar los resultados en pruebas estandarizadas y asegurar que los estudiantes del programa participen y evidencien avances significativos. ', 100, '- Identificar tempranamente las necesidades específicas de los estudiantes con NEE en relación a las asignaturas de lenguaje y matemáticas (habilidades críticas).\r\n- Implementar principios DUA en la planificación conjunta de las clases. \r\n- Crear e implementar materiales/recursos adaptados para facilitar el aprendizaje. \r\n- Monitorear continuamente el progreso de los estudiantes con NEE, adaptando las estrategias según los resultados observados. \r\n- Dominar herramientas técnicas e instrumentos estandarizados para la identificación y evaluación de las NEE. \r\n- Desarrollar instrumentos de evaluación de calidad, adaptados a las características de los estudiantes, considerando aspectos cognitivos, académicos, emocionales y sociales.  \r\n', '2025-11-14'),
(1728, 'Afianzar habilidades para lograr un desempeño de calidad en el cumplimiento del trabajo administrativo ', 100, '- Revisar detenidamente el trabajo administrativo, asegurándose de no cometer errores en la presentación de los informes (redacción, ortografía, coherencia). \r\n- Utilizar un lenguaje técnico en el desarrollo de los informes y otros documentos del programa. \r\n', '2025-06-30'),
(1729, 'Diseñar, planificar e implementar talleres que promuevan el desarrollo de habilidades descendidas en estudiantes con la condición autista, mediante el uso de estrategias psicopedagógicas inclusivas y basadas en evidencia, fomentando su autonomía, aprendizaje y participación activa en diversos entornos. ', 100, '- Identificar con precisión las habilidades descendidas en estudiantes con condición autista. \r\n- Diseñar talleres estructurados y dinámicos que incluyan actividades orientadas al desarrollo de habilidades sociales, comunicativas, académicas y cognitivas. \r\n- Utilizar metodologías y recursos inclusivos como sistemas alternativos de comunicación, juegos terapéuticos y estrategias de refuerzo positivo. \r\n- Implementar los talleres en un ambiente seguro y motivador, que promueva la interacción social y el trabajo colaborativo. \r\n- Realizar y socializar con la coordinadora PIE el progreso de los estudiantes para ajustar y mejorar las estrategias implementadas. \r\n- Involucrar a las familias en el proceso, como agentes indispensables para el logro de los avances. \r\n', '2025-06-30'),
