(1754, 'Fortalecer competencias profesionales para el trabajo de codocencia, mediante la planificación e implementación de estrategias inclusivas en la sala de clases, donde sea evidente para un observador externo la colaboración y la toma de decisiones pedagógicas (adaptaciones al currículum, metodologías y estrategias diversificadas, logros académicos de estudiantes con NEE).  ', 100, '- Realizar reuniones semanales con la docente de aula regular con el objetivo de planificar las actividades en aula, definir roles y responsabilidades, adaptar las actividades considerando las características del curso y evaluar el progreso de los estudiantes (identificar tempranamente a aquellos estudiantes que requieren mayores apoyos). \r\n\r\n- Participar activamente en el desarrollo de las clases, aplicando las estrategias acordadas las reuniones de planificación y propiciando la participación activa de todos los estudiantes (utilizar material concreto. \r\n', '2025-06-30'),
