(1773, 'Establecer a lo menos dos reuniones con coordinación para organización de las actividades de la semana.', 100, 'Convocar a reunión\r\nGenerar las consultas pertinentes para el funcionamiento del área', '2025-06-12'),
(1774, 'Colaborar y gestionar acciones administrativas del área ', 100, 'Calendarizar acciones, retroalimentar avance y solicitudes profesionales. Organizar actividades ', '2025-06-12'),
(1778, 'Diseñar e implementar intervenciones en formato de taller para el desarrollo de habilidades socioemocionales, comunicativas y cognitivas en estudiantes con condición autista, con el objetivo de promover la autonomía, participación social y  resultados académicos.', 100, '- Realizar un diagnóstico de las habilidades y necesidades de cada estudiante con condición autista, a través de observaciones directas, evaluaciones especializadas, y  entrevistas con la familia y otros profesionales. \r\n- Elaborar una planificación adaptada a las características de los estudiantes, con objetivos claros y específicos en áreas como habilidades cognitivas, sociales críticas al contexto escolar, comunicación, y resolución de problemas.\r\n- Coordinar con otros profesionales para garantizar que las estrategias utilizadas en los talleres sean coherentes con las necesidades de los estudiantes.\r\n- Evaluar periódicamente el progreso de los estudiantes mediante observaciones y retroalimentación, ajustando las actividades y estrategias de los talleres según sea necesario para maximizar el aprendizaje y la participación (informar de estos avances a coordinación PIE).\r\n- Organizar reuniones periódicas con las familias para compartir avances, estrategias y recomendaciones que puedan aplicar en casa, promoviendo un enfoque integral que refuerce los aprendizajes y habilidades adquiridas en los talleres.\r\n- Diseñar actividades que favorezcan la interacción entre los estudiantes con NEEP, creando oportunidades para que desarrollen habilidades sociales en un ambiente inclusivo y seguro.\r\n', '2025-06-13'),
(1779, 'Aportar al fortalecimiento de la cohesión del equipo, impulsando prácticas innovadoras basadas en la colaboración, convirtiéndose en referente para otros miembros de los beneficios del trabajo interdisciplinario. ', 100, 'Evidenciar compromiso y disposición para colaborar, motivando al equipo con una actitud proactiva al desarrollo de planes de trabajo de manera colaborativa. \r\n- Coordinar y participar activamente en reuniones de planificación y análisis, asegurando que todos los integrantes del equipo de aula puedan aportar desde su expertiz. \r\n- Promover la participación de otros profesionales en las aulas de recursos planificadas.\r\n- Impulsar la creación de talleres que involucren a todos los miembros del equipo en la toma de decisiones y en la ejecución de acciones concretas.\r\n- Retroalimentar los resultados de la implementación de apoyos colaborativos. \r\n', '2025-06-13'),
(1780, 'Implementar desde abril 2025 el taller de competencias parentales, promoviendo habilidades para el cuidado de los hijos, la comunicación efectiva, la resolución de conflictos y el establecimiento de límites saludables en padres de primer ciclo. ', 100, ' - Identificar durante el mes de marzo a los padres que deben participar del taller. \r\n- Utilizar ideas y material atractivo para la convocatoria de los padres. \r\n- Ejecutar el taller ya planificado desde el mes de abril en adelante.\r\n- Ofrecer herramientas concretas que sirvan de ayuda para que las madres y padres puedan aplicar las sugerencias en casa (plantillas para organizar rutinas. Guías para identificar emociones y/o estrategias para reforzar el buen comportamiento, etc.)\r\n- Medir resultados mediante encuestas de satisfacción o entrevista a algunos participantes. \r\n- Informar sobre el impacto del taller mediante un documento formal en al menos dos instancias durante el curso del mismo. \r\n\r\n', '2025-06-13'),
(1781, 'Consolidar el trabajo colaborativo', 100, '- Coordinar su participación estratégica en reuniones de planificación conjunta.\r\n- Participar activamente en la determinación de ingresos o egresos del programa. \r\n- Sostener comunicación permanente con todos los profesionales indicados en los planes de trabajo de los estudiantes que atiende.\r\n', '2025-06-13'),
(1782, 'Desarrollar e implementar un sistema de organización y gestión del tiempo que permita atender de manera equitativa y preventiva a todos sus estudiantes.', 100, '- Sostener en el tiempo un plan de organización que incluya una agenda estructurada, priorizando cumplir con los tiempos de los estudiantes que presentan NEEP. \r\n- Asegurar que todos sus estudiantes reciban la atención comprometida en sus planes de apoyo. \r\n- Informar mediante bitácoras los bloques de apoyo efectivamente realizados. \r\n', '2025-06-13'),
(1783, 'Diseñar, planificar e implementar talleres que promuevan el desarrollo de habilidades descendidas en estudiantes con la condición autista, mediante el uso de estrategias psicopedagógicas inclusivas y basadas en evidencia, fomentando su autonomía, aprendizaje y participación activa en diversos entornos.', 100, '- Identificar con precisión las habilidades descendidas en estudiantes con NEE. \r\n- Diseñar talleres estructurados y dinámicos que incluyan actividades orientadas al desarrollo de habilidades sociales, comunicativas, académicas y cognitivas. \r\n- Implementar los talleres en un ambiente seguro y motivador, que promueva la interacción social y el trabajo colaborativo. \r\n- Realizar y socializar con la coordinadora PIE el progreso de los estudiantes para ajustar y mejorar las estrategias implementadas. \r\n- Involucrar a las familias en el proceso, como agentes indispensables para el logro de los avances.', '2025-06-13'),
(1784, 'Fortalecer competencias profesionales para el trabajo de codocencia, mediante la planificación e implementación de estrategias inclusivas en la sala de clases, donde sea evidente para un observador externo la colaboración y la toma de decisiones pedagógicas (adaptaciones al currículum, metodologías y estrategias diversificadas, logros académicos de estudiantes con NEE).', 100, '- Realizar reuniones semanales con la docente de aula regular con el objetivo de planificar las actividades en aula, definir roles y responsabilidades, adaptar las actividades considerando las características del curso y evaluar el progreso de los estudiantes (identificar tempranamente a aquellos estudiantes que requieren mayores apoyos). \r\n- Participar activamente en el desarrollo de las clases, aplicando las estrategias acordadas las reuniones de planificación y propiciando la participación activa de todos los estudiantes (utilizar material concreto.', '2025-06-13');
INSERT INTO `planificacion` (`plan_id`, `plan_meta`, `plan_importancia`, `plan_acciones`, `plan_plazo`) VALUES
(1785, 'Brindar apoyo efectivo en la gestión y ejecución de las actividades del Programa de Integración Escolar, colaborando con  la correcta organización administrativa y logística. ', 100, '-. Asegurar el orden correcto de los expedientes de cada uno de los estudiantes de PIE.\r\n-. Mantener seguimiento irrestricto de LIRMI (horas de profesor jefe y de asignatura, registro libro PIE, aulas de recurso). \r\n-. Tomar acta de reuniones PIE y dejar registro de ellas en LIRMI, con la debida firma de cada uno de los participantes. \r\n-. Asegurar stock de materiales de uso frecuente en la oficina de coordinación. \r\n-. Mantener disposición para apoyar en  labores emergentes. ', '2025-06-13'),
(1786, 'Diseñar e implementar intervenciones en formato de taller para el desarrollo de habilidades socioemocionales, comunicativas y cognitivas en estudiantes con condición autista, con el objetivo de promover la autonomía, participación social y  resultados académicos.', 100, 'Realizar un diagnóstico de las habilidades y necesidades de cada estudiante con condición autista, a través de observaciones directas, evaluaciones especializadas, y  entrevistas con la familia y otros profesionales. \r\n- Elaborar una planificación adaptada a las características de los estudiantes, con objetivos claros y específicos en áreas como habilidades cognitivas, sociales críticas al contexto escolar, comunicación, y resolución de problemas.\r\n- Coordinar con otros profesionales para garantizar que las estrategias utilizadas en los talleres sean coherentes con las necesidades de los estudiantes.\r\n- Evaluar periódicamente el progreso de los estudiantes mediante observaciones y retroalimentación, ajustando las actividades y estrategias de los talleres según sea necesario para maximizar el aprendizaje y la participación (informar de estos avances a coordinación PIE).\r\n- Organizar reuniones periódicas con las familias para compartir avances, estrategias y recomendaciones que puedan aplicar en casa, promoviendo un enfoque integral que refuerce los aprendizajes y habilidades adquiridas en los talleres.\r\n- Diseñar actividades que favorezcan la interacción entre los estudiantes con NEEP, creando oportunidades para que desarrollen habilidades sociales en un ambiente inclusivo y seguro.', '2025-06-20'),
(1787, 'Fortalecer el rol docente como figura de autoridad educativa, mediante la implementación de estrategias que promuevan relaciones asimétricas saludables con los estudiantes, respetando y sosteniendo un rol de guía y facilitador de los aprendizajes.', 100, '- Demostrar manejo equilibrado de la autoridad en el aula, evitando confusiones de roles en las interacciones que se establecen.\r\n- Establecer límites claros en las relaciones con los estudiantes, garantizando el respeto mutuo y el cumplimiento de normas. \r\n- Reflexionar periódicamente sobre sus prácticas docentes para identificar comportamientos que favorezcan la simetría y corregirlos. ', '2025-06-20'),
(1788, 'Planificación de sus responsabilidades con la periodicidad que lo requiera. (semanal, quincenal, mensual)', 100, 'Realizar una carta Gantt y chequear el cumplimiento de manera semanal. ', '2025-06-30'),
(1789, 'Calendario y registro de reuniones periódicas con las personas de su área para dar seguimiento a las tareas entregadas y entregar nuevas tareas.', 100, 'Realizar actas de reuniones con acuerdos para chequear en las reuniones.', '2025-06-30'),
