(5330, '140301418', 125, 4, 'Tengo buena voluntad para apoyar a mis colegas cuando lo necesiten y yo pueda hacerlo.', '140301418'),
(5331, '140301418', 126, 3, '', '140301418'),
(5332, '140301418', 127, 3, 'En general, tengo muy buenas relaciones laborales en el colegio.', '140301418'),
(5333, '140301418', 128, 3, '', '140301418'),
(5334, '140301418', 129, 3, '', '140301418'),
(5335, '140301418', 130, 3, 'Siempre me he sentido parte de este colegio y del proyecto educativo', '140301418'),
(5336, '140301418', 380, 3, 'Siempre acepto las críticas, sobre todo cuando son constructivas. >Eso ayuda a mejorar mi trabajo.', '140301418'),
(5337, '140301418', 381, 3, '', '140301418'),
(5338, '140301418', 382, 3, 'Este es un punto que trabajé mucho y mi capacidad de adaptación es positiva. Estoy abierta a los cambios', '140301418'),
(5339, '140301418', 139, 3, 'Este punto lo trabajé mucho para ser objetiva y no tan emocional.', '140301418'),
(5340, '140301418', 140, 3, 'Soy muy empatica.', '140301418'),
(5341, '140301418', 141, 3, 'Esto lo mejoré considerablemente. Es algo trabajado,', '140301418'),
(5342, '140301418', 10001, 3, 'Es clave reconocer cuando uno se equivoca, pedir disculpas si es necesario y enmendarlos. En esto trabajo a diario en todos los aspectos de mi vida.', '140301418'),
(5343, '140301418', 385, 4, 'Me gusta trabajar en un ambiente grato. El trabajo en equipo es clave.', '140301418'),
(5344, '140301418', 386, 4, 'Creo que si lo soy. Valoro, cuido y ayudo a mi equipo', '140301418'),
(5345, '140301418', 387, 3, 'Hay que ser optimista y positivo para generar un buen ambiente laboral que permita realizar el trabjo de manera eficiente y eficaz.', '140301418'),
